import React from "react";
import styled from "styled-components";

function Projects(props) {
  return (
    <PortfolioWrapper>
      <h2>Projects</h2>
      <hr />
      <Project>
        <ProjectImg />
      </Project>
    </PortfolioWrapper>
  );
}

export default Projects;

const PortfolioWrapper = styled.div`
  width: 100vw;
  padding: 0 55px;
  min-height: 100vh;
  margin-top: 60px;
  h2 {
    font-size: 45px;
    margin: 0;
  }
`;

const Project = styled.div`
  width: 98%;
  min-height: 340px;
  margin: 25px auto;
  background: rgba(25, 155, 195, 0.5);
  box-shadow: 0 5px 10px rgba(0, 0, 0, 0.4);
  display: flex;
  justify-content: center;
  align-items: center;
`;

const ProjectImg = styled.div`
  width: 300px;
  height: 300px;
  background: #28af3e;
`;
